    false,nt"url": null,nt"notes": "This narrative report for Squaw Creek National
    Wildlife Refuge outlines Refuge accomplishments for May through July of 1941. The
    report begins by summarizing the weather conditions, water conditions, food and
    cover, and wildfires during this period. Wildlife- including migratory birds, upland
    game birds, furbearers, predators, rodents, and fish- is also covered. The Refuge
    development and maintenance section discusses physical developments and collections
    and receipts. The public relations section of the report describes recreational
    uses. Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
